import React from "react";

import "./App.css";
class App extends React.Component {
  state = {
    NewTaches: " ",
    TabListes: ["<3", "Danser", "<3"]
  };
  render() {
    return (
      <div>
        <h1> => TO Do LiSt &lt;= </h1>
        <button className={this.props.isRed ? "red-button" : "button"}>
          {this.props.children}
        </button>
        ;
      </div>
    );
  }
}

export default App;
